:"Creating new table","create-wooCommerce-product":"Create WooCommerce product table easily!","install-stock-sync-for-wooCommerce":"Install Stock Sync for WooCommerce","and sync your store products":"and sync your store products to Google Sheets. Use the synced Google Sheet to create table. It\u2019s easy!","install-now":"Install now","table-title":"Table title","please-reduce-title-to-save":"Please reduce title to save.","gsu":"Google Sheet URL","show-table-title":"Show Table title","table-top-elements":"Table top elements","hide-ent":"Show entries","hide-search-box":"Show search box","swap":"Swap","hide-title":"Hide title","disable-sorting":"Enable sorting","table-bottom-ele":"Table bottom elements","hide-entry-info":"Show entry info","hide-pagi":"Show pagination","swap-pos":"Swap position","swapped-pos":"Swapped position","theme-alert":"Themes cannot be used when the \"Import colors and text styles from sheet\" feature is enabled","doc-1":"How to Add Line Breaks in a WP Table?","doc-1-ans":"To incorporate a line break within a WordPress table, simply employ the `<span class='date-format'><code> &lt;br&gt; <\/code><\/span>` tag within the content of a specific cell.","doc-2":"What date format can I use?","doc-2-ans":"When working with date formats in your table, you have various options to choose from. Avoid using a <span class='date-format'><code>comma separator<\/code><\/span>, but consider formats such as <br> e.g. <span class='date-format'><code>2005-06-07<\/code> | <code>2005\/06\/07<\/code> | <code>2005 06 07<\/code> | <code>June 7- 2005<\/code> | <code>June 7 2005<\/code> | <code>7th June 2005<\/code><\/span>","doc-3":"Which one is better for link support?","doc-3-ans":"For enhanced link functionality, it's advisable to utilize <span class='date-format'><code>Smart Link<\/code><\/span> over the <span class='date-format'><code>Pretty Link<\/code><\/span>. Smart Link is known for its robust and user-friendly features.","doc-4":"Why my table design breaks?","doc-4-ans":"If you encounter design issues in your table, it may be due to the use of  <span class='date-format'><code>multiline content <\/code><\/span>within a single cell in your Google spreadsheets. To address this, insert the <span class='date-format'><code> &lt;br&gt; <\/code><\/span> tag within the text of the specific cell to create multiline breaks. Additionally, using comma-separated date formats can disrupt the table cell layout.","doc-5":"Why my table taking too long to load?","doc-5-ans":"If your table is taking too long to load, it may be due to the presence of a substantial amount of data in Google Sheets, along with images and links. If your sheet doesn't contain images or links, consider disabling <span class='date-format'><code>links and Image support<\/code><\/span> within the <span class='date-format'><code>Utility<\/code><\/span> settings of Table Customization to expedite table loading. Utilizing the cache feature can also improve loading times.","doc-6":"How long table data can take to update if Cache is activated?","doc-6-ans":"When the cache feature is active, updates to your table data are not reliant on your browser's cache. Changes made in your sheet may take approximately 15-40 seconds to reflect. To view the latest updates, simply refresh the page after this timeframe.","doc-7":"How do I find tutorials about using the plugin?","doc-7-ans":"Please visit our <a target='_blank' href='https:\/\/www.youtube.com\/playlist?list=PLd6WEu38CQSyY-1rzShSfsHn4ZVmiGNLP'>YouTube playlist<\/a>, where we post tutorials on how you can use different features of the plugin.","doc-8":"The zero(0) values in my google spreadsheets are not being created in the table, there are blanks. How to fix?","doc-8-ans":"Google spreadsheets assumes zero (0) values to be empty or blank and returns empty strings in response, which do not appear in your table, thus instead of directly using a zero value, you can resolve it by using zero with double\/single quotation or any 0 emoji. E.g. '0', \ud835\udff6, \ud83c\udd7e","doc-9":"How can I create a table from an imported XLSX file in google spreadsheets?","doc-9-ans":"Make sure to import the XLSX file into Google Spreadsheets in the following ways. Create a new blank spreadsheet, then navigate to `<span class='date-format'><code> File > Import > Upload<\/code><\/span>` Drag the XLSX files to import. Then share the spreadsheets from 'General Access'. Please visit our <a target='_blank' href='https:\/\/www.youtube.com\/playlist?list=PLd6WEu38CQSyY-1rzShSfsHn4ZVmiGNLP'>YouTube playlist<\/a>, where we post tutorials on how you can use XLSX file imported in google spreadsheets.","documentation":"Documentation","vt":"Video Tutorial","prof-need-help":"Get professional help via our ticketing system","faq":"Frequently Asked Question","get-plugin":"Get the most out of the plugin. Go Pro!","unlock-all":"Unlock all features","link-supp":"Link Support to import links from sheet","pre-built-sheet-style":"Pre-built amazing table styles where Each styles is different from one another","hide-row-based-on":"Hide your google sheet table rows based on your custom row selection","unlimited-fetch-from-gs":"Unlimited Row Sync and fetch unlimited rows from Google spreadsheet","export-json":"Export as JSON","export-csv":"Export as CSV","export-pdf":"Export as PDF","export-excel":"Export as Excel","print":"Print Table","copy":"Copy to Clipboard","live-sync-is-limited":"Live sync is limited to 30 rows.","table-10-limited":"In your free plan, you are limited to creating 10 tables. Upgrade to create more.","upgrade-pro":"Upgrade to Pro","for-showing-full":"for showing full google sheet.","data-source":"1. Data source","table-theme":"2. Table theme","tc":"3. Table customization","hide-row-col":"4. Hide Rows\/Column","data-source-title":"Data source","table-theme-title":"Table theme","tc-title":"Table customization","hide-row-col-title":"Hide Rows\/Column","save":"Save","lp":"Loading Preview...","dashboard":"Dashboard